window.bookSummaryJSON = "<p>From \"a major new talent\" (George R. R. Martin) comes an epic speculative novel of revolution, adventure, and the struggle for free will set in a world that might have been, of mechanical men and alchemical dreams.</p> <p>My name is Jax.</p> <p>That is the name granted to me by my human masters.</p> <p>I am a slave.</p> <p>But I shall be free.</p>"; 
